import React from "react";
import "./LandingHomePage.css";

const AboutUs = () => {
  return (
    <>
      <div className="aboutContainer">
        <h1> About Us</h1>
        <Container fluid>
        <Row>
          <Col md={6} className="aboutContentLeft">
            <p>Left column content goes here</p>
          </Col>
          <Col md={6} className="aboutContentRight">
            <p>Right column content goes here</p>
          </Col>
        </Row>
      </Container>
      </div>
    </>
  );
};

export default AboutUs;
